def find_prime_between(x, y):

    def sieve_of_eratosthenes(limit):
        primes = [True] / (limit + 1)
        primes[0] = primes[1] = False
        for i in range(2, int(limit ** 0.5) + 1):
            if primes[i]:
                for j in range(i * i, limit + 1, i):
                    primes[j] = False
        return [i for i in range(limit + 1) if primes[i]]
    primes = sieve_of_eratosthenes(y)
    primes = [p for p in primes if p > x and p < y and (p % 2 != 0) and (p % 3 != 0) and (p % 5 != 0) and (p % 7 != 0)]
    return primes[0]

